class EmailAuthBackend:
    """
    Unified authentication backend.

    The original implementation contained four separate methods
    (authenticate, authenticate2, auth_email, auth_email2) that
    duplicated logic for two different user models (django's built‑in
    User and the custom Provider model).  This refactored version
    provides a single ``authenticate`` method that can:

    * Authenticate a Django ``User`` (default behaviour).
    * Authenticate a ``Provider`` instance when ``user_type='provider'``.
    * Return a user object without password verification when
      ``password`` is ``None`` (mirroring the previous ``auth_email*``
      methods).

    All error handling is centralised – any exception results in ``None``,
    keeping the backend compatible with Django's authentication system.
    """

    def _fetch_user(self, username: str, user_type: str):
        """
        Retrieve a user instance based on e‑mail address.

        Parameters
        ----------
        username: str
            The e‑mail address supplied for authentication.
        user_type: str
            Either ``'django'`` (default) or ``'provider'`` indicating which
            model to query.

        Returns
        -------
        User instance or ``None``.
        """
        if user_type == "django":
            # ``django_User`` raises ``DoesNotExist`` if not found.
            return django_User.objects.get(email=username)
        elif user_type == "provider":
            # ``Provider`` is linked to ``User`` via ``idUser``; we perform a
            # case‑insensitive containment lookup to preserve the original
            # behaviour.
            return Provider.objects.filter(idUser__mail__icontains=username).first()
        else:
            # Unsupported user type – caller will receive ``None``.
            return None

    def authenticate(self, username=None, password=None, user_type="django"):
        """
        Authenticate a user by e‑mail address.

        If ``password`` is provided, it is verified against the stored hash.
        If ``password`` is ``None``, the method simply returns the user object
        (useful for email‑only look‑ups).

        Parameters
        ----------
        username: str | None
            The e‑mail address.
        password: str | None
            Plain‑text password to verify.  If omitted, the method returns the
            user without verification.
        user_type: str
            ``'django'`` for the built‑in ``User`` model or ``'provider'`` for the
            custom ``Provider`` model.

        Returns
        -------
        User instance or ``None`` if authentication fails.
        """
        if not username:
            return None

        try:
            user = self._fetch_user(username, user_type)
            if not user:
                return None

            # When a password is supplied we verify it; otherwise we return the
            # user object directly (mirroring the original ``auth_email*`` methods).
            if password is not None:
                if check_password(password, user.password):
                    return user
                return None
            return user
        except Exception:
            # Any exception (including DoesNotExist) results in a ``None`` return,
            # matching Django's expected backend contract.
            return None

    # Django authentication backends expect a ``get_user`` method.
    def get_user(self, user_id):
        try:
            return django_User.objects.get(pk=user_id)
        except django_User.DoesNotExist:
            return None


