def _init_logging():
    """Initialise the Waf logger."""
    Logs.init_log()


def _check_waf_version(version, wafdir):
    """Abort if the version of the running script does not match the library."""
    if Context.WAFVERSION != version:
        Logs.error(
            'Waf script %r and library %r do not match (directory %r)' %
            (version, Context.WAFVERSION, wafdir)
        )
        sys.exit(1)


def _handle_version_flag(current_directory):
    """If ``--version`` is present on the command line, print the version and exit."""
    if '--version' in sys.argv:
        Context.run_dir = current_directory
        ctx = Context.create_context('options')
        ctx.curdir = current_directory
        ctx.parse_args()
        sys.exit(0)


def _find_run_dir(current_directory):
    """
    Walk up the directory tree looking for a lock file or a ``wscript``.
    Returns the directory that should be used as the run directory.
    """
    # ------------------------------------------------------------------
    # Helper: decide whether a lock file points to the current directory
    # ------------------------------------------------------------------
    def _lock_file_points_here(env, cur):
        """Return True if the lock file points to *cur*."""
        for x in [env.run_dir, env.top_dir, env.out_dir]:
            if Utils.is_win32:
                if cur == x:
                    return True
            else:
                try:
                    ino2 = os.stat(x)[stat.ST_INO]
                except OSError:
                    continue
                else:
                    if ino == ino2:
                        return True
        return False

    # ------------------------------------------------------------------
    # Walk up the tree
    # ------------------------------------------------------------------
    cur = current_directory
    while cur:
        lst = os.listdir(cur)

        # 1) Look for a lock file – it may give us the exact run/top/out dirs
        if Options.lockfile in lst:
            env = ConfigSet.ConfigSet()
            try:
                env.load(os.path.join(cur, Options.lockfile))
                ino = os.stat(cur)[stat.ST_INO]
            except Exception:
                pass
            else:
                if _lock_file_points_here(env, cur):
                    Context.run_dir = env.run_dir
                    Context.top_dir = env.top_dir
                    Context.out_dir = env.out_dir
                    break
                else:
                    Logs.warn('invalid lock file in %s' % cur)

        # 2) If we have not yet set the run dir, look for a wscript file
        if not Context.run_dir and Context.WSCRIPT_FILE in lst:
            Context.run_dir = cur

        # 3) Stop climbing if the user asked for it
        no_climb = os.environ.get('NOCLIMB', None)
        if not no_climb:
            for k in no_climb_commands:
                if k in sys.argv:
                    no_climb = True
                    break

        # 4) Move up one level
        nxt = os.path.dirname(cur)
        if nxt == cur:
            break
        cur = nxt
        if no_climb:
            break

    # ------------------------------------------------------------------
    # No run directory found – handle the help case or abort
    # ------------------------------------------------------------------
    if not Context.run_dir:
        if '-h' in sys.argv or '--help' in sys.argv:
            Logs.warn('No wscript file found: the help message may be incomplete')
            Context.run_dir = current_directory
            ctx = Context.create_context('options')
            ctx.curdir = current_directory
            ctx.parse_args()
            sys.exit(0)

        Logs.error('Waf: Run from a directory containing a file named %r' %
                   Context.WSCRIPT_FILE)
        sys.exit(1)

    return Context.run_dir


def _change_to_run_dir(run_dir):
    """Perform ``os.chdir`` with proper error handling."""
    try:
        os.chdir(run_dir)
    except OSError:
        Logs.error('Waf: The folder %r is unreadable' % run_dir)
        sys.exit(1)


def _load_main_module():
    """Load the project's ``wscript`` and install the default entry points."""
    try:
        set_main_module(Context.run_dir + os.sep + Context.WSCRIPT_FILE)
    except Errors.WafError as e:
        Logs.pprint('RED', e.verbose_msg)
        Logs.error(str(e))
        sys.exit(1)
    except Exception as e:  # pragma: no cover – defensive
        Logs.error('Waf: The wscript in %r is unreadable' % Context.run_dir, e)
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)


def _run_waf_commands():
    """Parse command‑line options and execute the requested Waf commands."""
    try:
        run_commands()
    except Errors.WafError as e:
        if Logs.verbose > 1:
            Logs.pprint('RED', e.verbose_msg)
        Logs.error(e.msg)
        sys.exit(1)
    except SystemExit:
        raise
    except Exception as e:  # pragma: no cover – defensive
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)
    except KeyboardInterrupt:
        Logs.pprint('RED', 'Interrupted')
