# ----------------------------------------------------------------------
def waf_entry_point(current_directory, version, wafdir):
    """
    Main entry point used by the generated ``waf`` script.
    It delegates the original monolithic implementation to a set of
    well‑named helper functions for better readability and maintainability.
    """
    _init_logging()
    _check_waf_version(version, wafdir)
    _handle_version_flag(current_directory)

    # Store global paths used by the rest of the code
    Context.waf_dir = wafdir
    Context.launch_dir = current_directory

    # Find the directory that contains the project's ``wscript``
    run_dir = _find_run_dir(current_directory)

    # Switch to that directory and load the project's module
    _change_to_run_dir(run_dir)
    _load_main_module()

    # Finally, run the requested commands
    _run_waf_commands()


